  `uploadfiles` tinyint(1) NOT NULL DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='built in and custom external services' ROW_FORMAT=COMPRESSED;

