(2, 2, 'general', 'FORO', '<p>Una puesta en escena de Cultura Ciudadana parte de reconocer el espacio público como escenario clave en el que es posible la construcción colectiva de sentidos que nos vinculan con los demás, y que inciden en las representaciones que tenemos de la ciudad, de sus habitantes y de sus instituciones. En estas puestas también se abren espacios de interacción, de diálogo y de co-construcción de narrativas compartidas, sobre la capacidad de la ciudadanía de participar colectivamente para conseguir cambios voluntarios sostenibles en el tiempo.</p>\r\n<p><br>Entonces, al ser el espacio público el escenario de diferentes puestas en escena, podemos afirmar que en la calle tienen lugar acciones que nos enseñan o refuerzan, que emocionan o desencantan, develan y derrumban narrativamente las relaciones, y que vinculan o excluyen construyendo así la gran estructura dramática de cada día.</p>', 1, 0, 0, 0, 0, 0, 100, 0, 0, 512000, 9, 0, 1, 0, 0, 1708930780, 0, 0, 0, 0, 0, 0, 0, 0);

