(1, 2, 'ENTENDAMOS EL MODELO PEN DESDE UNA METÁFORA  TEATRAL DE LA VIDA COTIDIANA', '<p>Muchos de los problemas asociados a la Cultura Ciudadana, por su estrecha relación con el comportamiento individual y colectivo,<br>pueden resultar difíciles de abordar porque están relacionados con temas polémicos, incómodos y complejos. En estos casos, cuando los<br>llamados a la acción tradicionales no logran tener efectos concretos, resulta oportuno un mecanismo de “puesta en escena”.</p>', 1, 0, 0, 0, '', 0, 'O:8:\"stdClass\":3:{s:9:\"timespent\";i:0;s:9:\"completed\";i:0;s:15:\"gradebetterthan\";i:0;}', 100, 1, 0, 0, 5, 1, 0, 0, 0, 0, 1, 0, 0, 0, '', 480, 640, 0, 0, 640, 480, '#FFFFFF', 0, 0, 0, 0, 0, 1708924859, 0, 0, 0);

