(1, 2, '¿CÓMO ES UNA PUESTA EN ESCENA DE CULTURA CIUDADANA?', '<p>Muchos de los problemas asociados a la Cultura Ciudadana, por su estrecha relación con el comportamiento individual y colectivo, pueden resultar difíciles de abordar porque están relacionados con temas polémicos, incómodos y complejos. En estos casos, cuando los llamados a la acción tradicionales no logran tener efectos concretos, resulta oportuno un mecanismo de “puesta en escena”.</p>\r\n<p>Las puestas en escena con elementos performáticos, escenográficos y narrativos son experiencias que dotan de nuevos sentidos a los contextos, resignifican las interacciones entre la ciudadanía y proponen relatos compartidos alternativos que movilicen, a través de la esperanza, la posibilidad de construir colectivamente una convivencia tranquila y disfrutable en la ciudad.</p>\r\n<p>Al igual que un espectáculo teatral, que puede abordarse desde lo creativo, lo investigativo, lo espacial o lo interpretativo, las acciones pedagógicas con enfoque de Cultura Ciudadana pueden tener énfasis en la dimensión performática, en los elementos escenográficos o en los relatos que se busquen transformar.</p>', 1, 0, 0, NULL, 0, 'a:2:{s:10:\"printintro\";i:1;s:8:\"showtype\";i:1;}', 0, 2, 1708931405);

